import React from "react";
import little_lemon_logo from "../images/little_lemon_logo.png"

const Nav = () => {
    return(
        <nav>
            <img src={little_lemon_logo} alt="Little Lemon Logo" ></img>
            <ul className="nav-menu">
                <li><a>Home</a></li>
                <li><a>About</a></li>
                <li><a>Menu</a></li>
                <li><a>Reservations</a></li>
                <li><a>Order Online</a></li>
                <li><a>Login</a></li>

            </ul>
        </nav>
    )
}

export default Nav;
